import "./AddEditGradeForm.scss";
import { Form, Image, Button } from 'semantic-ui-react';

export function AddEditGradeForm() {
  return (
    <Form className='add-edit-grade-form'>
      <Form.Input  name="jornada" placeholder="Nombre del curso"/>
      <Form.Input  name="letter" placeholder="Nombre del curso"/>
      <Form.Input  name="day_trip" placeholder="Nombre del curso"/>
      <Button type='submit' primary content="Crear" />
      
    </Form>
  )
}
